package com.store.open.openStore.config;

import java.util.Arrays;

import org.slf4j.LoggerFactory;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.beans.factory.annotation.Value;
import org.springframework.boot.CommandLineRunner;
import org.springframework.security.core.userdetails.UserDetails;
import org.springframework.security.crypto.bcrypt.BCryptPasswordEncoder;
import org.springframework.stereotype.Component;

import com.store.open.openStore.model.UserDto;
import com.store.open.openStore.model.enums.USER_ROLE;
import com.store.open.openStore.service.UserService;

@Component
public class DbInitializer implements CommandLineRunner {
    private static final org.slf4j.Logger LOG =
      LoggerFactory.getLogger(DbInitializer.class);
    
    @Autowired
    private UserService userService;
    
    @Value("${ecommerce.admin.email}")
    private String email;
    
    @Value("${ecommerce.admin.password}")
    private String password;
    

    @Override
    public void run(String...args) throws Exception {
    	try {
    		
    		UserDetails userDetails = userService.loadUserByUsername(email);
    		if (userDetails != null) {
    			System.out.println("password for admin is: " + userDetails.getPassword());
    		}
    	}
    	catch (Exception e) {
    		UserDto userDto = new UserDto(null, "admin", "admin", "123456321654", email, "admin", Arrays.asList(USER_ROLE.ADMIN.toString()),password,
    				"data:image/jpeg;base64,");
    		userService.save(userDto);
    		LOG.info("saved admin user 'admin'");
    	}
    }
}